import React from "react";
import "../styles/global.css";
import myPhoto from "../assets/myphoto.jpg";

const About = () => {
  return (
    <div className="about">
      <div className="about-content">
        <h1>About Me</h1>
        <p>
          Welcome to my digital space! I'm Jose Chemmanoor, a passionate BTech student specializing in Computer Science and Engineering...
        </p>
      </div>
      <div className="about-photo">
        <img src={myPhoto} alt="Jose Chemmanoor" />
      </div>
    </div>
  );
};

export default About;
